import { Component, OnInit } from '@angular/core';
import { ProductsService } from 'libs/shared/src/lib/services/products.service';

@Component({
  selector: 'admin-edit-product',
  templateUrl: './edit-product.component.html',
  styleUrls: ['./edit-product.component.css']
})
export class EditProductComponent implements OnInit {

  constructor(private productservice: ProductsService, private route: ActivatedRoute, private location: Location){}

  ngOnInit(): void {
    this.route.params.subscribe((params: any) => {
      this.categoryService.getCategory(params.id).subscribe(res => {
        this.id = params.id
        this.categoryForm.patchValue(res.category)
      })
  })
  }

}
